            <p id='words'>It turns out that the states with the highest percentage of $100k+ income households are mostly concentrated in the northeast, with the exception of Alaska.The states with the lowest percentage of these households are mostly in the southeast.</p>
            <p id='words'>It's pretty shocking to see that over 38 in 100 households in Maryland earn six-figure incomes or more per year while only 15 in 100 households in Mississippi do.</p>            
            <p id='words'>Another interesting question might be <b><i>which states have the most households with incomes concentrated around the national median of $55k?</i></b></p>
            <p id='words'>To answer this, we can look at what percentage of households in each state have an income within $20k of the median (i.e. household incomes in the range $35k - $75k) :</p>
            
