<p id='words'>Over one in three households in Idaho earn an income within $20k of the national median.</p>
<p id='words'>Towards the bottom of the list we see Massachusetts has only about one in four households earning incomes in this range. This isn't too surprising since we saw in the previous table that Massachusetts has the third-highest percentage of $100k+ households.</p>
<p id='three_dots'><b>. . .</b></p>
<p id='words_last'>We've seen from this analysis that very few households in the U.S. actually earn an annual income equivalent to the national median of $55k and that incomes vary wildly from one state to the next.</p>
<hr>
<p id='end_notes'>Data for this analysis comes from the <a href='https://factfinder.census.gov/faces/tableservices/jsf/pages/productview.xhtml?pid=ACS_16_5YR_DP02&src=pt' target='_blank'>2012-2016 American Community Survey</a>. I used R to clean and munge the data and D3.js to create the visualizations.</p>
